function scroll_top() {
	$('#scroll-top').on( 'click', function() {
		$('html, body').animate({scrollTop: 0});
		return false;
	});

	if( $(window).scrollTop() > 700 ) {
		$('#scroll-top').fadeIn();
	} else {
		$('#scroll-top').fadeOut();
	}

	$(window).scroll(function() {
		if( $(window).scrollTop() > 700 ) {
			$('#scroll-top').fadeIn();
		} else {
			$('#scroll-top').fadeOut();
		}
	});

};

